import axios from 'axios'
import React from 'react'
import { useEffect } from 'react'


export const Posts = () => {
    let setData = []
    console.log(setData)
    useEffect (() =>{
        axios.get("https://jsonplaceholder.typicode.com/posts").then((response) =>{
            console.log(response.data)
            setData()
        })
    },[])
  return (
    <div>Post</div>
  )
}
